    margin-top: 1rem;
    background-color: $w-main;
    .cart-title{
        margin-bottom: 2rem;
        font-size: 32px;
    }
    .product-header{
        display: flex;
        justify-content: space-between;
        margin-right: 1rem;
        border-bottom: 4px solid $c-main;
    }
